import React from 'react';
import './../css/App.css';

export function CopyrightText() {
  const corpo = 'A JS JS-ing with JS corporation';
  const copyrightText = 'KFA copyright 2020';
  const copyrightMoreText = 'Keep Froth Alive copyright 2020';
  return <div class="mt-52">
            <span className="copyright">{corpo}</span><br/>
            <span className="copyright">{copyrightText}</span><br/>
            <span className="copyright">{copyrightMoreText}</span>
        </div>;
}

export default CopyrightText;
